function populatePaidUsersTable() {
    var paidUsersTableBody = document.getElementById("paidUsersTableBody");
    paidUsersTableBody.innerHTML = "";
    users.forEach((user, index) => {
        if (new Date() <= user.expireDate) {
            var row = `<tr class="user-row">
                            <td>${index + 1}</td>
                            <td>${user.username}</td>
                            <td class="password">🔐 Locked</td>
                            <td>${user.phone}</td>
                            <td>${user.expireDate.toDateString()}</td>
                        </tr>`;
            paidUsersTableBody.innerHTML += row;
        }
    });
}

