function drawExpiryChart() {
    var expiryDates = users.map(user => user.expireDate);
    var labels = [];
    var data = [];
    expiryDates.sort((a, b) => a - b);
    expiryDates.forEach(date => {
        var formattedDate = date.toDateString();
        if (!labels.includes(formattedDate)) {
            labels.push(formattedDate);
            data.push(1);
        } else {
            var index = labels.indexOf(formattedDate);
            data[index]++;
        }
    });

    var expiryChartCanvas = document.getElementById("expiryChart").getContext("2d");

    var expiryChart = new Chart(expiryChartCanvas, {
        type: 'bar',
        data: {
            labels: labels,
            datasets: [{
                label: 'Number of Users',
                data: data,
                backgroundColor: labels.map(date => {
                    var expiryDate = new Date(date);
                    return expiryDate <= new Date() ? 'red' : 'green';
                })
            }]
        },
        options: {
            scales: {
                y: {
                    beginAtZero: true
                }
            },
            animation: {
                animateRotate: true
            }
        }
    });
}

function drawStatusChart() {
    var paidCount = 0;
    var unpaidCount = 0;

    users.forEach(user => {
        if (new Date() <= user.expireDate) {
            paidCount++;
        } else {
            unpaidCount++;
        }
    });

    var statusChartCanvas = document.getElementById("statusChart").getContext("2d");

    var statusChart = new Chart(statusChartCanvas, {
        type: 'pie',
        data: {
            labels: ['Paid', 'Unpaid'],
            datasets: [{
                label: 'User Status',
                data: [paidCount, unpaidCount],
                backgroundColor: ['green', 'red']
            }]
        },
        options: {
            animation: {
                animateRotate: true
            }
        }
    });
}



